with open('/Users/tsutsumi/csv/子情報_2事業再構築補助金支援実績_2.csv', 'a') as g:
    pprint.pprint("2事業再構築補助金支援実績--------------start---")
    writer_child = csv.writer(g)

    for list_url in list_urls:
        driver.get(list_url)
        # テーブル内容取得
        tableElem = driver.find_elements_by_class_name("c_table_contents")
        trs = tableElem[1].find_elements(By.TAG_NAME, "tr")

        # ヘッダ行は除いて取得
        for j in range(2,len(trs)):
            tds = trs[j].find_elements(By.TAG_NAME, "td")
            lineDebug = ""
            line = []
            # 先頭に認定機関IDを入れる
            lineDebug += "%s," % (driver.find_element_by_xpath("//*[@id=\"search\"]/div[2]/div/dl[1]/dd").text)
            line.append(driver.find_element_by_xpath("//*[@id=\"search\"]/div[2]/div/dl[1]/dd").text)    
            
            for k in range(0,len(tds)):
                lineDebug += "%s," % (tds[k].text)
                line.append(tds[k].text)
            writer_child.writerow(line)
pprint.pprint("2事業再構築補助金支援実績--------------end---")
g.close()

